import React, { Component } from 'react'
import { func } from 'prop-types';


function Student(){
   const show = () => {
      return console.log('Half dude');
    }
    return (
        <div>
            <h1>Hello {props.name}</h1>
            <button onClick={show}>Click</button>
        </div>
    )
};




export default Student;
